  return (
    <div className="main">
      <div className="main__wrapper">
        <NavBar />
        <div className="main__descritption">
          <FadeIn>
            <div className="main__descritption-text">
              <a>
                WIR BAUEN – IHRE WÜNSCHE UND TRÄUME WIR BAUEN – IHRE WÜNSCHE UND
                TRÄUME
